import React from 'react';
import AdminNavbar from '../ui/AdminNavbar';

function AdminDashboard() {
  return (
    <div>
      <AdminNavbar />
      <h1>대시보드 화면</h1>
    </div>
  );
}

export default AdminDashboard;
